import React from 'react'
import MediaCard from './Card';
import { Grid } from '@material-ui/core';
import Emily from '../../images/sample_image.jpg';

function Ambassador() {
    return (
        <Grid container spacing={4} justify="center">
            <Grid item xs={6} sm={4} md={3}>
                <MediaCard 
                    name={"Lu Wang"}
                    linkedin={""}
                    image={Emily}/>
