            <Grid item xs={6} sm={4} md={3}>
                <MediaCard 
                    name={"Neelanshi Sharma"}
                    linkedin={""}
                    image={Emily}/>
            </Grid>
            <Grid item xs={6} sm={4} md={3}>
                <MediaCard 
                    name={"Soohyun Ahn"}
                    linkedin={""}
                    image={Emily}/>
            </Grid>
        </Grid>
    )
}

export default Ambassador
